import { useState, useEffect } from "react";
import { GET } from "../../utils/http";
import "./index.css";

const Contact = ({ data }) => {
  const { firstName, image, email, birthDate } = data;

  return (
    <div className="contact">
      <img src={image} alt="lastName" />
      <h3>{`${firstName}`}</h3>
      <h3>{`${email}`}</h3>
      <h3>{`${birthDate}`}</h3>
    </div>
  );
};

export default Contact;
